double calc(int pos)
{
	if (pos <= 0) return 0;
	double ret = 0;
	int num = pos / stp;
	num = min(num, 2710);
	ret = sheet[num];
	num = num * stp;
	for (int i = num + 1; i <= pos; ++i) {
		ret += 1.0 / (double)(i);
	}
	return ret;
}

int main()
{
	ios::sync_with_stdio(false);
	long long W, L;
	while (cin >> W >> L) {
		static int tst = 0;
		if (W == 0 && L == 0) break;
		cout << "Case " << ++tst << ":" << endl;
		if (L == 0) {
			if (W % 8 != 0) 
				cout << "Situation Impossible." << endl;
			else {
				cout << "On Average Bob Reaches Round ";
				cout << "8.00" << endl;
			}
		} else {
			int st = max(0, (int)(ceil((double)(W - 7 * L) / 8.0)));
			int ed = W / 8;
			if (st > ed) {
				while (1) cout << "GG" << endl;
			}
			double cons = (double)(W + L) / (double)(ed - st + 1);
			//cout << st << " " << ed << endl;
			cons *= (calc(ed + L) - calc(st + L - 1));
			cout << "On Average Bob Reaches Round ";
			cout << setiosflags(ios::fixed) << setprecision(2) << cons << endl;
		}
	}
	return 0;
}
